('gl', '_template', 'atutor_accessibility_text', '<p>ATutor inclúe unha serie de funcionalidades deseñadas para asegurar que o contido sexa accesíbel para todas as persoas usuarias potenciais, incluíndo aquelas con conexións a Internet lentas, navegadores vellos, e persoas con discapacidades que empreguen tecnoloxías asistivas para acceder á Web. Estas funcionalidades están descritas en detalle máis abaixo. En función do tema que empregues, ATutor pode incluír todas ou algunhas das características listadas aquí. O tema por defecto incúe todas elas. </p> \r\n<ol>\r\n<li><strong> Ligazóns de salto: </strong> na esquina superior esquerda existen unha serie de ligazóns de salto que permiten a quen emprega tecnoloxía asistida saltar os elementos de navegación convencional e dirixirse directamente ao contido que está a ser despregado. Presiona a tecla Tab (tabulador) unha vez que rematou de se cargar a páxina para avanzar á primeira ligazón de salto; logo presiona Enter para reposicionar o contido na parte superior da pantalla. Alternativamente, as persoas usuarias poden presionar Tab dúas veces e logo Enter para ir directamente ao menú principal. Presiona a tecla Tab unha terceira vez para saltar á primeira opción (Inicio) na barra de navegación. Á áncora de contidos tamén se pode acceder coas teclas [Alt-c], entón é posible ir para arriba da área de contido, independentemente de onde se sitúe o cursor na pantalla. Presiona a tecla Tab por cuarta vez para saltar á páxina de accesibilidade (esta páxina) para obter máis información sobre como configurar ATutor para traballar eficazmente con tecnoloxías asistivas. <br/> <br/>\r\nOutros enlaces de acceso directo inclúen: \"saltar táboa\" para que as persoas poidan avanzar sobre varias táboas de datos para accederen rapidamente ao contido que aparece despois da táboa, \"saltar os códigos\", onde poden avanzar sobre os emoticon situados no inferior do formulario de publicación de mensaxes nos foros.<br /><br /></li>\r\n<li> <strong> Teclas de acceso: </strong> a accesibilidade por teclado foi agregada a varias funcionalidades de ATutor. Para activar as teclas de acceso, presiona Alt+ o numero asignado ou letra. As teclas de acceso son asignadas dinamicamente ás pestanas na navegación principal. Para a primeira pestana será asignada [Alt-1], á segunda pestana [Alt-2], e así sucesivamente. Ten en conta que non todos os navegadores soportan teclas de acceso. <br/> <br/>\r\nTeclas de xerais de acceso:\r\n<ul>\r\n<li>[Alt-1 até Alt-0] Principais teclas de navegación</li>\r\n<li>[Alt-,] Tema anterior (ou sinal de menor <)</li>\r\n<li>[Alt-.] Tema seguinte (ou sinal de maior >)</li>\r\n<li>[Alt-.] Resumo (ou sinal de maior > mentres estás fóra o contido do curso)</li>\r\n<li>[Alt-j] Saltar Menu</li>\r\n<li>[Alt-s] Presentar (activo nas páxinas de moitos formulario)</li>\r\n<li>[Alt-c] Ir para arriba nos contidos (atallo de vínculo superior e navegación)</li>\r\n</ul>\r\n<br/>\r\nTeclas de acceso para contido\r\n<ul>\r\n<li>[Alt-n] Contidos</li>\r\n<li>[Alt-p] Propiedades </li>\r\n<li>[Alt-g] Glosario </li>\r\n<li>[Alt-r] Visualización</li>\r\n<li>[Alt-a] Accesibilidade</li>\r\n<li>[Alt-s] Gardar</li>\r\n</ul>\r\n<br/>\r\nTeclas de acceso ao Chat\r\n<ul>\r\n<li>[Alt-c] Ir a Compoñer mensaxe</li>\r\n<li>[Alt-r] Actualizar mensaxes</li>\r\n<li>[Alt-m] Ir a Lista de mensaxes</li>\r\n<li>[Alt-q] Saír do Chat</li>\r\n</ul>\r\n<br/>\r\nTeclas de acceso da bandexa de entrada\r\n<ul>\r\n<li>[Alt-r] Respostar as mensaxes</li>\r\n</ul>\r\n<br/>\r\n\r\nTeclas de acceso do editor visual\r\n<ul>\r\n<li>[Alt-q] Ir a barra de botóns</li>\r\n<li>[Alt-z] Ir á área de edición do contido</li>\r\n<li>[Alt-x] ir para o elemento (bottm)</li>\r\n</ul>\r\n<br/>\r\n</li>\r\n<br/>\r\n<li> <strong> Validador de accesibilidade: </strong> mentres usan o editor de Contido do ATutor, as e os docentes poden comprobar a accesibilidade do seu contido para teren a certeza de que é accesíbel para todo o alumnado, incluídas as persoas que utilizan tecnoloxías de asistencia ou tecnoloxías antiguas. Aínda que uses o editor de contido, selecciona [Alt-a] para abrir o verificador de accesibilidade. </li>\r\n<br/>\r\n<li> <strong> Texto alternativo: </strong> todas as imaxes no ATutor inclúen un texto alternativo que describe a imaxe ou a súa función. Cando as imaxes non teñen significación para a aprendizaxe, deixa o atributo alt en branco para que as ferramentas de tecnoloxías asistidas poidan ignorar a imaxe. </li>\r\n<br/>\r\n<li> <strong> Navegación alternativa: </strong> ferramentas de navegación global, xerárquica e secuencial están dispoñibles para que as persoas usuarias poidan visualizar ou estruturar o contido dun xeito que facilite o seu estilo de aprendizaxe. A Mapa do sitio de ATutor proporciona unha lista completa de todos os contidos e ferramentas dispoñibles, así todas as funcionalidades dun curso son accesibles desde un só lugar.</li>\r\n<br/>\r\n<li> <strong> Resumir/Continuar: </strong> ATutor lembra a última páxina visitada cando as persoas saen do contido do curso, así para ir ao foro, por exemplo, poden rapidamente atopar o lugar onde se detiveron. A localización do contido tamén é lembrada entre sesións, así que, cando volven a ATutor, poden simplemente premer na ligazón Resumir na listaxe de cursos de Os meus cursos, ou escolleren a ligazón de resumo na parte superior da pantalla, unha vez nun curso. Empregando a tecla de accesibilidade [Alt-.] tamén volverá á páxina de contido anterior que estaba a ver despois de entrar nun curso. </li>\r\n<br/>\r\n<li> <strong> Agochar menús: </strong> para persoas que utilizan tecnoloxías asistidas superadas, que non soportan textos en columnas ou en táboas, é posíbel ocultar o menú de navegación de contidos de forma que o contido será amosado nunha presentación lineal. Agochar o menú de contido tamén resulta de utilidade para quen usa pantalla pequena. </li>\r\n<br/>\r\n<li> <strong> Pescudar e ordenar: </strong> a maioría das táboas de datos son acompañadas por unha ferramenta de busca ou filtrado, para que os rexistros específicos poidan ser amosados ​​na táboa, reducindo a cantidade de datos mostrados nun determinado momento. A maioría das táboas de datos poden tamén ser ordenadas, seleccionando a cabeceira da columna e permitindo así diminuír a visualización de datos. </li>\r\n<br/>\r\n<li> <strong> Asociacións de cabeceira da táboa: </strong> todas as táboas de datos son marcadas co elemento TH para garantir que quen usa un lector de pantalla é capaz de navegar a través dos datos amosados ​​e comprender o que cada celda de datos representa </li>\r\n<br/>\r\n<li> <strong> Etiqueta de formulario:</strong> todos os campos do formulario dentro do ATutor son marcados usando o elemento ETIQUETA para permitir que sexan debidamente descritos e accesíbeis para quen utiliza tecnoloxía asistida. Deste xeito o etiquetado tamén fai posíbel premer na etiqueta dun campo de formulario para activar o campo. Isto proporciona unha maior área para as persoas que teñen dificultade de colocar o punteiro do rato sobre un campo pequeno, como un botón de opción ou unha caixa de verificación. </li>\r\n<br/>\r\n<li> <strong> Folla de estilos: </strong> sempre que for posíbel, a presentación do contido en ATutor é controlada por elementos da folla de estilo. Isto permite ás persoas usuarias substituír a aparencia por defecto de ATutor e aplicar os seus propios estilos de presentación (é dicir, aumentar o tamaño das fontes, estilos de letra, cores, etc) </li>\r\n<li> <strong> Foco campo de formulario: </strong> para páxinas onde o contido principal é un formulario, o cursor será automaticamente colocado no campo primeiro para que despois de ser cargada unha páxina de formulario , as persoas poidan comezar a cubrir o formulario. Tamén poden optar por desactivar o foco nos formularios nas súas preferencias, se interfire co uso de teas de formulario. </li>\r\n<br/>\r\n<li> <strong> Tamaño relativo de imaxes: </strong> con navegadores que admitan o redimensionamento de imaxes, as iconas do ATutor poden ser aumentadas para utentes con visión reducida, facéndoos máis facilmente visíbeis. (Por exemplo, para Netscape 7, preme Alt +). Sempre que é posíbel o cambio de tamaño é empregado noutras funcionalidades do ATutor, ademáis de cando a interface é ampliada ou diminuída, mantendo sempre a simetría na pantalla. </li>\r\n</ol>', '2011-08-25 10:37:08', ''),
