('gl', '_template', 'atutor_is', 'strong><em>ATutor </em></strong> é un <strong> Learning Content Management System (LCMS) Open Source Web-based </strong> planificado para a accesibilidade e a adaptabilidade. As persoas administradoras poden instalar ou actualizar o ATutor en minutos, crear temas individuais e darlle unha nova apariencia, tamén extender as súas funcionalidades desenvolvendo módulos de recursos. Docentes poden rapidamente montar, embalar, e redistribuír contidos e dirixir os seus cursos en liña. O alumnado aprende nun entorno de aprendizaxe adaptativo', '2011-08-27 20:56:45', ''),
('gl', '_template', 'atutor_links', '<ul>\r\n<li> <a href=\"http://atutor.ca/forums/index.php\"> Foro </a> - Mensaxe para o foro de persoas usuarias </li>\r\n<li> <a href=\"http://atutor.ca/services/index.php\"> Servizos de Apoio </a> - Se precisas da a nosa axuda hai soporte dispoñíble </ li>\r\n<li> <a href=\"http://atutor.ca/atutor/translate/index.php\"> Tradución </a> - Descarga paquetes de idiomas, ou faite tradutor(a) </li>\r\n<li> <a href=\"http://atutor.ca/services/licensing.php\"> licenzas </a> - o software ATutor está dispoñible gratuitamente baixo certas condicións </li>\r\n<li> <a href=\"http://atutor.ca/atutor/download.php\"> Descargar ATutor </a> - Todo o software preciso para executar o ATutor pode ser descargado aquí </li>\r\n</ ul>', '2011-08-24 19:28:37', ''),
