('gl', '_template', 'chat_help_display_blurb', '<p>Aviso: as ligazóns <em> Ir a </em>  e as <em>teclas rápidas </em> só aparecen se tes activado as<em> Axudas para a Navegación </em> nas preferencias </p >\r\n\r\n<ul>\r\n<li>As ligazóns <em> Ir a Teclas rápidas </em> da parte superior levan a unha lista de teclas rápidas para o Chat. </li>\r\n<li> A <em>Área  de Mensaxe </em> exhibe as mensaxes máis recentes (ata dez). </li>\r\n<li> A ligazón <em> Ir  a mensaxes </ a> lévate para o inicio da lista de mensaxes (Alt + M) </ li>\r\n<li> A ligazón <em> Actualizar mensaxes </em> link permite comprobar se hai novas mensaxes (Alt + R). </ li>\r\n<li> O campo <em> Compoñer unha mensaxe </em> e o botón <em> Enviar </em> permítenche compoñer e enviar mensaxes (Alt + C para ir a Compoñer unha mensaxe, Intro para enviar unha mensaxe). </ li>\r\n</ ul>', '2011-08-28 15:58:06', ''),
